// src/client/index.tsx
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

// Render the App component inside the root div
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
